import React from 'react'
import 'bootstrap/dist/css/bootstrap.css';
import './navbar.css';

const Navbar =()=>{
    return(
        // <div style={{
        //   backgroundColor:'black',
        //   height:'8vh',
        //   borderBottomLeftRadius:20,
        //   borderBottomRightRadius:20,
          
        //   }}>
          // <img src="data:image/png;base64," alt="" style={{
          //   height:'4.5vh',
          //   marginLeft:'-95%',
          //   marginTop:10
          // }}/>

        // </div>
        <nav class="navbar navbar-expand-sm bg-dark navbar-dark fixed-top">
  <a class="navbar-brand" href="#" style={{marginLeft:20,marginRight:10}}>
    <img src="data:image/png;base64," alt="" style={{
      height:'4.5vh'
    }}/>
    
    
  </a>
  <h3 style={{
    color:'white',
    marginTop:'0.3%',
    marginRight:'1%'
  }}>Notes</h3>
  <ul class="navbar-nav">
    <li class="nav-item">
      <a class="nav-link" href="#" style={{marginRight:'1%'}}>Home</a>
    </li>
    <li class="nav-item">
      <a class="nav-link" href="#"style={{marginRight:'0%'}}>About Us</a>
    </li>
  </ul>
  <h3 class="statement" style={{
    color:'#FFFFE0',
    marginTop:'0.3%',
    marginLeft:'15%',
    fontFamily:'“Comic Sans MS”, “Comic Sans”, cursive',
    
  }}>You Will Write We Will Rember !!</h3>
</nav>
    );
}
export default Navbar;
